import { Grid, GridList, GridListTile, GridListTileBar, IconButton, Paper } from '@material-ui/core';
import React from 'react';
import DriveEtaIcon from '@material-ui/icons/DriveEta';

interface Expense
{
    id: number,
    purseId: number,
    title: string,
    date: Date,
    money: number,
    topic: string
}


const expenses: Expense[] = [];

export const ExpensesList: React.FC = () => {

    return(
        <GridList cellHeight={200}
        cols={3}
        >
            <GridList cellHeight={200} cols={1}>
                {/* <GridListTileBar title="Title"
                subtitle="Subtitle" titlePosition="top"
                actionIcon={
                    <IconButton>
                        <DriveEtaIcon />
                    </IconButton>
                }
                /> */}
                <Grid item xs={12}>
                   <Paper>
                        Title item   
                    </Paper> 
                </Grid>
            </GridList>
        </GridList>
    );
}

export default ExpensesList;
